import React from "react";
import "./city.css";
import city from "../../data/city.json";

const City = () => {
  return (
    <div className="container">
      <div className="row">
        {city.map((city) => (
          <div className="city col-md-4 py-2">
            <img src={city.image} alt=""></img>
            <p>{city.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
};
export default City;
